import React from "react";

function UserWishs(props) 
{

  var countries_returned = [{id: 0,userId: 0, userName: "0", present: "0", price: 0}];
 
  for (let i = 0; i < props.wishs.length && countries_returned.length <= 5; i++) 
  {
    countries_returned[i] = props.wishs[i]
    countries_returned.push("");
  } 

  const listItems = countries_returned.map((w) => 
    <li key={w.id}><a href={"https://localhost:3000/Wish/"+w.userId}>{w.present}</a></li>      
  );

  return (
      <div className="UserWishs">
        {listItems}
      </div> 
    );
  }
  
  export default UserWishs;
